// FigLexerInit initializes any static state used to implement FigLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewFigLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func FigLexerInit() {
	staticData := &FigLexerLexerStaticData
	staticData.once.Do(figlexerLexerInit)
}

// NewFigLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewFigLexer(input antlr.CharStream) *FigLexer {
	FigLexerInit()
	l := new(FigLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &FigLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "FigLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

